import React from "react";

export default function Acceul() {
  return (
    <>
      <h1>Hello Acceul</h1>

      <div className="jumbotron jumbotron-fluid">
        <div className="container">
          <hr className="my-2" />
          <p>More info</p>
          <p className="lead">
            <a className="btn btn-primary btn-lg" href="/" role="button">
              Jumbo action name
            </a>
          </p>
        </div>
      </div>
    </>
  );
}
